import { useState, useEffect } from 'react'

function SongList () {

    const [allSongs, setAllSongs] = useState([])

    useEffect (() => {
        fetch(`http://localhost:9292/songs`)
            .then(r => r.json())
            .then(songs => setAllSongs(songs))
    }, [])

    return(
        allSongs.map(song => {
            <div>
                <h3>{song.title}</h3>
            </div>
        })
    )
}

export default SongList
